ي يافع يمكنه متابعه هذا الحساب ستجدون لا وجود للمراه علي الاطلاق، كانه مجتمع بلا اناث، يزرع نصف رجالهم ارحاما ليتمكنوا من الحمل والانجاب، ومن عادات وتقاليد يافع قتل النساء اذا خالفن قوانين القبيله انقذوا خديجه',1),(122,'﻿ياغبي الصيام ليس لعاشوراء بل لموسي اذا دينك ماتعرفه ولا تعرف ع منو و شنو تصوم ويحجي بالدين روح اقره التاريخ اقره كتب السنه وشوف منو قتل منو وليش هوه الي يقتل خير الخلق يعتبر صحابي وين ايمانه اصلا حتي اليهود مايسون هيج بس امثال يزيد ومن يتبعه',4),(123,'﻿نظام پلید اخوندی برای نجات جان مردم ایران از کرونا از کشورهای دیگر کمک نمیگیرد با امضای پتیشن ما را یاری کنید لینکهای پتیشن رئیسی جلاد۶۷ قتل عام۶۷',3),(124,'﻿تو اول عكس وطن فروش را از پروفايلت دليت كن سبب همه اين قتل ها همين بيناموس است حالا شروع فيلم است كمي صبر كنيد تك حمله هاي طالب ها شروع نشده هنوز شيطاني هاي همسايه ها شروع نشده كمي صبر كنيد يك نفر هم خطا نميخوره از ميل تفنگ اينها',4),(125,'﻿خاب دطير انتم مو مال نقاش واحترام ابد الي يقول سيدنا يزيد قتل سيدنا الحسين هذا براسه عقل',1),(126,'﻿جلال طلياني المنبوش الصفحه قتل اكثر من عادل عبدالمهدي',1),(127,'﻿هذا تكتيك قتل المباره',2),(128,'﻿اخلي يستجوبوا بالتحقيق كم ناشط قتل وذبها براس الحشد',1),(129,'﻿الطبيب المجرم الي قتل زوجته طعن بالسكين',1),(130,'﻿وللمعلومه ماكو سني قتل لان لم يجامل ولا مسيحي تهجر لان ميجامل اني من محافظه تعتبر ذات اغلبيه سنيه ، ومنطقتي مليئه بالعصا ئب بل هي جميعها محتله من المليشيات ، ما شفت يوم سني اجي للموكب يلطم حتي يجامل او يخاف من العصا ئب او الشيعه بالعكس داشوف الناس ولا كانه ايام محرم',2),(131,'﻿هل عدم اقامه الحد علي المسيء للرسول ، خطا؟ ويبرر تخوين الدوله والمجتمع؟ هل الرسول ايضا اخطا بعدم قتل المسيئين له ،، باعتبارهم كفار يبدو ان دعوات بعض الناس باقامه الحد ليست حبا في الدين وانما كرها للدوله والمجتمع وبغيه الفتنه الدواعش ليسوا بمسلمين',1),(132,'﻿ع اساس يعاقبون نفسهم لان قتلوه طيب هم شعليهم واحد قتل واحد ليش يتحملون ذنبه هذا باي منطق بعدين التناقض مو ع اساس هم يشفعون زين ليش تعاقب نفسك هشكل اذا يشفعولك شو ما تسوي',1),(133,'﻿اذن، يمكن القول بصراحه ان من قتل الحسين انما هو الدوله البيزنطيه، وكذلك يمكن ان يقال ان من قتل باق