ي قتلوا وباگوا واستعبدوا لعد اللي تفجروا بالاف السيارات المفخخه والاحزمه الناسفه وانقطعت رؤوسهم ومثلوا بجثثهم وانقتل منهم شاب بساعه وحده وقبلها الاف المقابر الجماعيه انترست بيها الارض، منو همه نسيت هذا كله لو تتناسي من اجل المنصب وفتات الموائد',1),(189,'﻿شيخ قيس الخزعلي قبل فتره طلع وكال الي قتلوا الامام الحسين عليه السلام هم من الحميراء وهم من الفرس وكل هل من المعقول نتهم ايران بقتل الامام',1),(190,'﻿التعاون الهلال الحكام السعوديين قتلوا متعه اللعب',2),(191,'﻿شلون ميخصني ذوله قتلوا ساداتي؟',1),(192,'﻿حماك الله يا داعي الدعاه وعز من اواك سريرتنا ونيتنا علي حبك عقدناها بحق المصطفي والمرتضي رب السما يرعاك بمنزله الحسن وحسين وام قتلوا ابناها عسي يا ابو اسماعيل من تجاهل منصبك يفداك ومن حاول بك الباطل يموت ويبعث اشقاها',2),(193,'﻿اي سياسه قتلوا من اجل لقاح تعلم تقرا فكر لا تجي السياسه لانها عفانه',2),(194,'﻿روايه الرشوه موجوده عد ياسر الحبيب وامير القريشي الي همه مثال اعلي لسوالفكم وجذبكم اما سالفه الرسول موصي علي ويكله اذا قتلوا بنتي وقتلوك انطيهم ورده واسكت ولا تحجي وياهم هاي حتي الجاهل مايصدكها تره',1),(195,'﻿شوكت راح تقتنع انو هذا ضرغام تابع لجهه معينه ودينفذ مخططاتهم لو ما كان تابع لاحد جان من زمان قتلوا وخلصوا منه',2),(196,'﻿هل يعقل طلب علاج من قاتل امارايتم حمم النيران صبت عليكم الطفل لاذنب له لكن من جلبه العدو لن يرحمك الخيانه لن تنجيك قتلوا صفوفابمدالبصرمن اطفال المدارس الافغان طفلك واحدمنهم ولايهم بعينه نعوذبالله من الكفروالخيانه والذلهوالفقر موت بكرامهوجوع اغلي من حياه خيانهورجاءعدو',1),(197,'﻿علي فكره هذا مشهد عادي، شو بدي اكتب عن الاعدامات ولا المقابر الجماعيه ولا عن الخطف، قصه صغيره ،اثنين من اصدقائي اختفوا وبعد فتره اكتشفت انهم اصبحوا معهم عادوا وبعد عودتهم بيومين قتلوا رجل وقطعوه وعبوه بكيس سماد متخيل انك تشوف انسان مقطع بكيس سماد عندك منظر مرعب عندي اصبح عادي',1),(198,'﻿اوكي جاي تسب هذول الناس الي ماتوا و صاروا نفط لان قتلوا الحسين، زين اطفال الموصل هم قتلوا الحسين حتي يستاهلون يندفنون تحت الانقاض و همه احياء',1),(199,'﻿انا مصدوم ؟ بس خاف يقصد عمر ابن سعد لان هو لاعن الي قتلوا الحسين معقوله يسب عمر ابن الخطاب ؟ ما اتصور',1),(200,'﻿ما يسمي بالمسلمين قتلوا اهل نبيهم لعن الله هؤلاء المسلمين المزيفين لعنه الله بني اميه',1),(201,'﻿انتم خوارج هذا الزمن عثمان ابن عفان زوج بنتين لرسول الله رضي الله عنهما وعلي اب ابي طالب قتلوا علي يد مسلمين ويدعوان الاسلام ويدعون انهم افضل من عثمان وعلي رضي الله عنهم وارضاهم',1),(202,'﻿الذين قتلوا جمال رحمه الله عليه والكل شاهد والصوره خير دليل هم من الفءه القليله التي يدعمها ملككم',1),(203,'﻿المغذور عبدالله الاغبري موعد تنفيذ القصاص لمن قتلوا عبدالله الاغبري هو يوم غدا السبت في ساحه ميدان التحرير م',1),(204,'﻿قتلني ابوبكر وعمر ابو بكر وعمر قتلوا الحسين عليه السلام بسبب فكرهم طبعا راح تكولي ماتو قبل مقتل الحسين عليه السلام الجرائم الي تصير ب هذا الزمن بسبب افكار الماضي العبوديه استمرت الالف السنين ف نفس الشي فكر عمر وابو بكر فكر ارهابي متشدد لن ينتهي الا بظهور صاحب الزمان',1),(205,'﻿اجاك احد دك الباب عليك وطلعك من البيت وقال الك تعال دك والطم؟ كلامك الي مو دقيق الفرع الساكن بي اني بي ٤٠بيت ٣٠بيت من مذهب السنه شو محد جبرهم ع شي وبعدين موضوعي عمومي ماكو داعي اتحصره بالميليشيات الي همه نفسهم قتلوا الشيعه مشكلتكم تخلطون كل شي مع بعض',1),(206,'﻿الامام الحسين ع السلام قتله اجدادك اللقطاء الفجار الزناديق هم عمر وابو بكر ويزيد وشمر ،،،،اجدادك هم من قتلوا الامام الحسين ،،،،،لعنه الله عليك وعلي امك عائشه المنافقه',1),(207,'﻿ليش الامام الحسين ليش قتلوا لانه مابايع يزيذ عليه اللعنه ورفض هذا الشي ونصبوا للامام العداء بس اريد افهم همه عدهم عقول من يحجون هيچ يفكرون بالي يحچوا لۆ عمياني لۆ حقد لو شنوو ؟',1),(208,'﻿علي اساس بالمغرب ما قتلوا شباب بعمر الورد بطريقه وحشيه واغتصابات ومعاناه اللي صار بالجزائر من تغيير المتاح الله يلطف بحالنا وحالهم',1),(209,'﻿يا لطيف علابيها قتلوا هذاك الامام نضك كان يحاول يقنعهم بالاسلام لا اله الا الله',1),(210,'﻿سيدنا ايران شنو دخلها بالموضوع يعني انته تامن من السعوديه الي اجدادهم قتلوا الالف بالعراق من ٢٠٠ سنه ولهذا اليوم وتعتقد انهم راح يغيرون فكرهم خاشقجي ابنهم ومن مدرستهم لان خالفهم الراي قطعوا بالمناشير وبغير دوله ذوله تربوا علي الارهاب',1),(211,'﻿شنو هالخرط يا حدود يا هذيان الي كاعد تهذي بي شبيجت رمضان بشعبان وين كان اكو شي اسمه حدود بس باقي تكول الجماعه مافيزوا من قتلوا الحسين مو جنه مرتاح شرجعك تنهق علينه',1),(212,'﻿بس الله يعلم كم احب هذا الرجل قيس الخزعلي الذي نتف شوارب شيوخ الشر، مت قتلوا شهداء سبايكر',4),(213,'﻿لعنهم الله اقسم بالله العظيم ان لقاحهم هو السبب ودمه في ذمتهم ليوم الدين الله يغفر له ويرحمه ويجعل مثواه جنات النعيم امين الله يعظم اجركم هذولي المجرمين قتلوا مئات من الناس هذا العام بلقاحهم الشيطاني وسط تكتم اعلامي',4),(214,'﻿هذاالاسلوب المتبع مع امثالك يدافع عن حركه رعاع وارهابيين قتلوا وروعوا الامنين مغتصبين متشددين بعنجهيه وياليتهاعنجهيه سنع اعاجم اذناب ايران تخطيط امريكي اماناقصات عقل ودين روح وابحث عن تفسيرها يابربري ومترفع مااناقش امراه ونت من وين جيت اكيدمن قرن ابليس ليتهابركت عليك يوم جابتك',1),(215,'﻿هذا الوزغ منين لعن الله امه تهيات وتعاونت وساعدت وشاركت بقتل الحسين ع واهل بيته واصحابه ولعن الله من سمع بذلك ورضي من الاولين والاخرين الي يوم الدين وعن اي اسلام يتكلم هذا حسين مني وانا من حسين هؤلاء قتلوا النبي محمد ص بقتلهم الحسين ع',1),(216,'﻿و شنو الغريب اسامه بن زيد مولي الرسول عليه الصلاه والسلام بالعكس كانوا يخلصونهم من الظلم يعتقونهم من الظلم الجواري حكم الهي او ما ملكت ايمانكم الاسلام دين رحمه ما قتلوا النساء بالحرب احسنوا اليهم و صاروا ملك يمين',3),(217,'﻿الشمر بن ذي الجوشن هو كان من ضمن اللي قتلوا الامام الحسين بن علي بن ابي طالب عليهم السلام',1),(218,'﻿سبحان الله، ورجعوا جماعته قتلوا، وتستمر السلسله، القتال من اجل الكرسي من الاف السنين، ورغم وجود الاف القصص، بس الانسان مياخذ عبره',3),(219,'﻿الدين بالاتباع وليس بالابتداع ولو بكي المسلمون قتلاهم لماتوا كمدا وقد قتل من هو افضل من المسلمين باستثناء محمد صلي الله عليه وسلم وهو نبي الله يحيي عليه السلام ولم يامرنا الله بالبكاء والعويل وجعل موته ذكري وغيره انبياء قتلوا اخيرا نعم الا الي الله تصير الامور',3),(220,'﻿انا انسان احب الارقام منذ الي سنه ماقدمتموه هو قتيل فقط السوريين ب سنوات نص مليون غزه منذ الي عدد ايام المقاومه يوم من يوم هدنه بدون قتال معلومه عدد الفلسطينين الي قتلوا بحروب خارج فلسطين اكثر من الي قتلو داخل فلسطين',1),(221,'﻿ليس بامكانهم اليوم بان يهددون حد بالموت مثلما اخذوا منا اخذنا منهم وتم دحرهم الي عقر دارهم اليوم من يقتلنا هم التحالف بدعمهم للشرعيه قتلوا الشعب بالجوع والفقر والغلاء الفاحش دعموا الشرعيه للقتال في الجنوب هذي الحقيقه',1),(222,'﻿بالنسبه للناس الحساسه تبعت السلميه والمجتمع الدولي الي بتعترض علي العمليات الاستشهاديه وانها كانت غلطه اتفضل حرر فلسطين بالهتافات والسلميه وتعاطف العالم اليهود لما احتلوا هالارض ما عملوا مناظرات او مسيرات بالعكس قتلوا الاطفال قبل الكبار وما راعو نظره احد لهيك عزيزي تفضل اخرس',4),(223,'﻿الي قتلوا الحسين كلهم يرحع اصلهم الي السعوديه والخليج وفارس ونسبوهم للشيعه وكذبتوا وصدقتوا كذبتكم والجهله موجودين بالطائفتين واليوم وامس شفنا الجهله شلون صايره الي تسب الحسين بيوم استشهاده وياريت تتبعون سنه الرسول مثل متكولون لان الحسين حفيده وسيد شباب اهل الجنه',1),(224,'﻿اي بس قتلوا المتعه وراحو منها',1),(225,'﻿كافي غباء وجهل شلون قتلوا وهمه ميتين ؟',2),(226,'﻿لا يا اموي تافه اجدادك بالتاكيد هم من قتلوا سبط رسول الله لكن هاي السفسطه التافهه ما تعبر بس عالاغبياء',1),(227,'﻿هم جماعتك السياسيين الشيعه الي قتلوا ونهبوا وكذالك سياسيين السنه والكرد لهم جزء بخارب ودمار البلد وليس الشيعه المدنيين الناس العاديين والبسطاء الي يقاتلون من اجل لقمه العيش والقوت اليومي لا تعمم من تتكلم اتكلم عدل احنا ناس محترمون ونحن نعلمكم شنو الاسلام والدين',1),(228,'﻿سلبوا بنات الرساله المحمديه الاصيله و حرگوا الخيام و قتلوا ابن بنت الرسول و يدعون انه هم مسلمين و علي نهج الخلافه اي اخلاق هاي ما عدكم غيره ما عدكم شرف',1),(229,'﻿اني المهاجر قد اتيتك مبعدا واليك احمل عبره شكوانا قتلوا باسمك كل طفل مرهف والحضن يشكي والعناق جفانا قتلوا باسمك حلمه بمعيشه تسعي اليها روحنا ورؤانا قطفوا باسمك يا حبيب المصطفي دمعا كاعطيه البحار جمانه عبدالرحمن',3),(230,'﻿تتذكر بالمظاهرات شلون نزلت القبعات الزرق؟ شلون كانت الشباب تقتل و تختطف؟ ايام راح تعيش في ذاكرتنا طول حياتنا والله شباب تشرين لا ناقه و لا جمل ما طلعوا الا الاصلاح و طرد الفساد ثق الي اعطاك نصيحه بضرب هاي الشباب هم نفس الشياطين الي قتلوا الحسين يتبع',1),(231,'﻿وثيقه لعرفات تبين موقع دفن اسرائيليين قتلوا بمعركه السلطان يعقوب بسوريا كشف موقع الكتروني عبري',2),(232,'﻿العثماني من طنجه المهربون من قتلوا حياه والبحريه ما شافوهاش فيديو',3),(233,'﻿الولايات المتحده تحيي ذكري هجمات ايلول بثلاثه الاف شمعه',3),(234,'﻿انت تحب هذا الشي وهو سلوك مررره خطير فكر بامك بابوك فكر باهلك فكر بمن ينتظرك ماذنب اهلك لو فجعوا بخبر توفي فلان حاول تتخلص من هذا السلوك الخاطئ وماذنب لو يتمت اب لاسره او قتلت نفس بغير وجه حق ماذنبه',3),(235,'﻿لو ندقق تلاقي المزه ع قولتك هي سبب الحروب من قتلت قابيل لهابيل ليومنا هذا',3),(236,'﻿اللهم العن قتلت الحسين عليه السلام الي يوم الدين',1),(237,'﻿هي الحكومه نفسه قتلت القاده بعد كلبي شلون تقتل دواعش',1),(238,'﻿انت ارهابي رقم واحدانت من قتلت اامه المساجدوعلماءاليمن انت اكبرمجرم وخاين للوطن والشعب',1),(239,'﻿بلادك الكريهه لا تحب اي شي ينتكي للاسلام بلادك الحمارات تدعم انقسام اليمن تدعم انقسام الجزائر تدعم قتل اللاطفال الفلسطنين تدعم وتوالي اليهود بنت قواعد عسكريه لليهود في اليمن قتلت اطفال اليمن اسوي من اليهود بلادكم',1),(240,'﻿اضحكني بايدن منظمه طالبان تعتبر المراءه عبد تلعب به كما تريد تتوقع منها احترام النساء هاذا غير وارد طبعا لان طالبان قتلت واغتصبت ملايين النساء وقتلهم ايضا والان تتوقعون منها ان تحسن سلوكاتها لا اظن هاذا',3),(241,'﻿التشكليه هذي قتلت التجانس بين اللعيبه الي يشوف المباراه يحلف ان الاعبين اول مره يلعبون مع بعض الحل كالاتي خروج جحفلي دخول الفرج خروج مدالله ودخول الشهراني خروج موسي او قوميز ودخول بيريرا ويغير التشكيله الي',3),(242,'﻿الهلال التعاون تشكيله م تصلحح للهلال والله قتلت المتعه الهلاليه',3),(243,'﻿هسه عرفتوا الكواتم الي قتلت المتظاهرين كواتم مصدرها الانبار',2),(244,'﻿العراق قتلت امثالكم بطائفيه وتحريض عله غيركم لان تعرفون زين اسيادكم يعيشون بنيعمنم بس عله طائفيه وتحريض الله يلعن كل شخص ايقض فتنه نائمه قتلني ابوبكر وعمر',1),(245,'﻿واميركا التي قتلت الافغان والعراقيين والفيتناميين وفي دقائق قتلت اكثر من ١٥٠ الف ياباني دون تمييز وغيرهم سوي من جوعته بالحصار او دعمها للارهاب الصهيوني اليس دوله ارهابيه؟؟',4),(246,'﻿قبل كان الثوار بساحات التظاهر يسبون ويلعنون بالحكومه ورجالاتها وسياسيها لان سرقوا اموال البلد وخلونه علي الرنگات وبالمقابل المليشيات قتلت من عندهم ٨٠٠ واحد ومنها ريهام اليعقوب الله يرحمها بس من تجي ركضه طويريج تشوف القاتل والثائر كتف بكتف يركضون ويصيحون هيهات منا الذله',4),(247,'﻿هؤلاء يعت