ه وهرب احمد شاه مسعود حتي اغتيل اثناء هروبه واعتزل المشهد قلب الدين حكمتيار وهرب ايضا ،',4),(646,'﻿هو اصلا جان علماني مو اخواني بس حسن لبنا لمن اغتيل تغير قطب و صار ضد عبد الناصر و عبد الناصر صديق مقرب من سيد قطب ايام شبابه يعني الكرسي عقيم',4),(647,'﻿مفيش اي مقارنه الجيش العراقي لم يهرب وانما اغتيل باسلحه متقدمه ومتخلفه وباليورانيوم، كما اغتيل معه ملايين من العراقيين',1),(648,'﻿ياليل من هالمتخشقجين عياله ماناحو عليه مثلكم شوف سليم خان الي اغتيل بقطر ولا محمد عبداللطيف',3),(649,'﻿الي اغتيل مع ابنته حبيب داوود ب حزب الله اللبناني وعائله اسامه بن لادن ب السعوده وخاف متعرف ازيدك من الشعر بيت من اغنياء السعوديه وطبعا السعوديه مشهودتلهم ابد مطالع منهم ارهابيه',4),(650,'﻿سوال بعتبارك متابع الاخبار من هو الذي اغتيل مع ابنته في طهران ؟ اين عائله اسامه بن لادن ؟ التمويل الامريكي العسكري الحشد هل هو صحيح ام كذبه ؟',4),(651,'﻿قال بن الجوزي من قارب الفتنه بعدت عنه السلامه، ومن ادعي الصبر وكل الي نفسه، ورب نظره لم تناظر واحق الاشياء بالضبط والقهر اللسان، والعين؛ فاياك ان تغتر بعزمك علي ترك الهوي مع مقاربه الفتنه؛ فان الهوي مكايد، وكم من شجاع في صف الحرب اغتيل، فاتاه ما لم يحتسب، ممن يانف النظر اليه',3),(652,'﻿تعرض حزب الاصلاح في عدن الي جرائم بشعه وحرب ممنهجه استهدفت كوادره بالتحديد ، حيث اغتيل العديد من كوادره وقياداته رغم مشاركته في معركه تحرير المدينه من المليشيات الحوثيه كما تكشف فيما بعد بتقارير هصور حيه ان الامارات هي من كانت تقف وراء كل تلك الجرائم ذكرا اغتيال حليس',4),(653,'﻿ليش ما تحبون علي ابو الحسين ؟؟لانه اغتيل من قبل فارسي ؟؟؟',1),(654,'﻿اغتيل احمد شاه مسعود قبل غزو الولايات المتحده لافغانستان، وحتي قبل هجمات سبتمبر، لكن بحسب روايه الهلاس الهارب ناصر الدويله فانه تحالف مع الامريكان للاطاحه بطالبان بعد الغزو تحالف معهم من قبره بعد وفاته هالدويله الشرود كاذب كبييير',2),(655,'﻿عبد الكريم الشيخلي جان صدام حسين يسميه توامي ساعده بتصفيه حردان التكريتي واحد من منافسين صدام علي الحكم وساعد بنقل المنفذين من الكويت بسلام تاليها انقتل بطريقه بشعه بعد سنه من استلام صدام الحكم وكذلك صالح مهدي هم اغتيل بالسم بمنفاه بفنلندا ماعتقد راح اشوف مثل هالسايكوباث لاحقا',1),(656,'﻿خالي العزيز هيه تشرين كم شهر وخلصت ولي جاي يحصل في الجنوب كله تصفيه حسابات بين الاحزاب ول هذه ضرغام ياخذهم قبل فتره للحدود ايريد ايحرر فلسطين هو منطقته ممحرر من الايراني وره يجي الانبار هذه مدفوع الثمن واكثر قيادي تشرين الشرفاء الي انسجن ولي اغتيل ولي طفر خارج العراق',1),(657,'﻿مالكوم اكس مايو فبراير ، واسمه عند مولده مالكوم ليتل، ويعرف ايضا باسم الحاج مالك الشباز، هو داعيه اسلامي ومدافع عن حقوق الانسان امريكي من اصل افريقي افريقي امريكي ، اغتيل بسبب دعوته ودفاعه عن افكاره المناهضه للعنصريه',4),(658,'﻿لذلك اغتيل دوله الرئيس رفيق الحريري',4),(659,'﻿من البدايه كلت علاء الركابي ذيل وهذا هم ضرغام لان شكو ناشط وقائد للمظاهرات اغتيل لو عمليه اغتيال فاشله او مختبيء زيدون ابوفراك الله يتره وما يكدر يتحرك براحته اما علاء وضرغام لحد الان محد اتكلم عنهم هو صفاء بكبره وما خلص حتي قبره فلشو ضرغام وعلاء احزاااااب ولكم لا تصلون غشمه',1),(660,'﻿حتي هو اغتيل',1),(661,'﻿اغتيل مرتين مره بستشهاد رفيق الحريري ومره بحصار الرئيس فواد السنيوره بقصر الحكومه شهور',4),(662,'﻿صحيح هو احد الشيوخ من بوسنه يقال انه اغتيل من خلال حادث السياره',2),(663,'﻿الشهيد رفيق الحريري اول من كافح الفساد ولذلك اغتيل',4),(664,'﻿هكذا اغتيل مدير بلديات كربلاء اليوم المهندس الشريف عبير الخفاجي من تشوف هيج مقطع تحس فعلا انت في غابه مصطفي الكاظمي كاعد؟ نايم؟ علي الاقل تعزيه لاهله اذا ما مشغول رجاءا',1),(665,'﻿شجاب هاي علي هاي يعمري ؟ الوزني اغتيل بيد عصابات معلومه وكان اغتياله سياسي منظم وعن سابق اصرار وترصد ضمن سلسله اغتيالات مريبه اما الرجل مدير بلديه كربلاء تم قتله بسبب استهتار شخص معلوم لسبب معلوم واثناء حدث معلوم يعني مو غيله ليش دهرب عل الوادم يبوو مزيعل عيب',1),(666,'﻿تاريخ لما جاء زروال ليفعل قانون التعريب، اغتالت الدوله العميقه بمباركه البربريست المغني معطوب لوناس حصل الامر لتهييج المنطقه ضد قانون التعريب،، فبمجرد ان يصبح معطوب شهيدا حسبهم ، ستصبح افكاره غير قابله للنقاش، وهو بالفعل ما حصل وحتي بوتفليقه ساهم في تازم الوضع',4),(667,'﻿محور الممانعه مبتهج لان امريكا راح تطلع يعني خلاص زال خطر استهدافهم وما يدرون ان الولايات المتحده الامريكيه اغتالت ليلي العطار بصاروخ كروز انطلق من بحر العرب ليدخل عليها من الشباك',4),(668,'﻿ان اردنا تحقيق العداله، فلنبدا بمحكامه من اغتال رفيق الحريري، فالجهه الغادره، هي نفسها من اغتالت احلم اللبنانيين اليوم وستبقي تغتالها لمصلحه الايراني والسوري والحوثي لبنان رفيق الحريري بهاء الحريري',4),(669,'﻿متي يستيقظ شيعه العراق من وهم ايران عمق للتشيع استخدمت ايران شيعه العراق كمرتزقه ليس لهم اي قيمه داخل العراق وخارج حدود العراق افقرتهم،اذلتهم،قطعت المياه عنهم اغتالت اولادهم والقائمه تطول ايران باعت شيعه الافغان لطالبان شلون بيك وانت الشيعي العربي لا تساوي عندها عفطه',1),(670,'﻿جهز نفسك يا قاتل يا مجرم انت لا تعرف عن الحياه الا الخيانه والتبعيه انت لا تعرف عن الحياه الا وتهلث بعد المال بعت دينك بقليل من الدراهم اغتالت خيره علماء عدن وهم خارجين من بيوت الله يا مجرم يتمت اطفال رملت نساء بدون وجهه حق لارضاء انجس البشر من عيال زايد يا خ ن زير؟',3),(671,'﻿ان المنظومه التي اغتالت رفيق الحريري وانكشفت مع قرار المحكمه الدوليه انما ارادت انهاء لبنان والسيطره عليه، واغتيال مرحله النهوض والاعمار والنمو بهاء الحريري',4),(672,'﻿هذوله شغله بس طيارين اقصد فرق الموت مال البصره اللي اغتالت محافظ البصره والدكتوره رهام وغيرهم كلش هواي فرق الموت اللي حركت الناس العزل فرق الموت اللي الي الان تمارس شغلها وما مقتل ايهاب وفاهم وهاشم الهاشمي واخرهم مدير البلديه وهاي كله والحكم مو بيده لو بيده يصير انكس من صدام',1),(673,'﻿رحم الله الحمدي الذي باغتياله اغتالوا اولاد الكلب وطن',4),(674,'﻿وهل الاغتيالات غريبه علي جماعه الاخوان ؟ اغتالوا السادات وحاولوا اغتيال حسني مبارك في اديس ابابا واغتالوا الرئيس الجزائري بوضياف واغتالوا ادباء وكتاب وصحفيين،الارهاب جزء اساسي من فكر حسن البنا ومن اتي من بعده',4),(675,'﻿ستكون نهايه الدوله التونسيه اذا اغتالوا قيس سعيد وستكون بدايه افغنه تونس',4),(676,'﻿اه يا جمانه، تتذكرين من كتبتي پوست طوله مترتين بالفيسبوك علي تارا فارس وطلعتي بنتيجه انو تارا مريضه نفسيا لان ستايلها ميناسب مزاجچ وفي نفس الوقت چانت تارا مستمتعه بحياتها ويه اصدقاءها، ووراها بشهرين اغتالوا تارا، من يومها واني اشوف اي شي تكتبيه تافه عن اي امراه سوقيه او محترمه',1),(677,'﻿الاهلي الحزم حسون وخبراني اغتالوا فرحه الجمهور بطله الاهلي الجديد',3),(678,'﻿بمثل هاذ اليوم قبل سنه بعض الجلاب اغتا