ايدن اثبت التاريخ ان افغانستان مقبره الامبراطوريات وسننهي الحرب بعد عاما من سفك الدماء',3),(1765,'﻿كل الخوارج المارقين يزعلون تطبيق الشريعه وهي منهم براء لاياتي من وراءهم الي الفساد ويكثر سفك الدماء وانتهاك الاعراض وسلب الاموال يحل الخوف ويذهب الامن والي الله المشتكي هو نعم المولي ونعم النصير من هذه الموجه الخارجيه القادمه والسفهاء كالعاده يهللون ويكبرون للفتن',2),(1766,'﻿اتوقع المقصد سفك الدماء وقتل النساء وتعذيبهم',1),(1767,'﻿القوات وما ادراك ما القوات من سفك الدماء الي الاغتيالات الي المخدرات واخيرا وليس اخرا التهريب عبر صقر وغيره',1),(1768,'﻿تم فتح كابل وغزو القصر الرئاسي وقرئت سوره الفتح المبين وسيطره من انهكهم الشوق الي سفك الدماء وحصل الهروب الجماعي لمن استطاعوا اليه سبيلا الي الخارج وكما سهلت اميريكا بالامس عوده طالبان من جحورها الي الحكم فغدا ستقود العالم الي الاعتراف بحكومتها الظلاميه',2),(1769,'﻿انتم اسوء ماانجبت البشريه اقمتم دولتكم علي سفك الدماء والسرقه والقتل وصنعتم تمثال باسم الحريه التي لاتعرفون عنها الااسمها ولن يصلح الله عمل المفسدين',2),(1770,'﻿الولايات المتحده الفاشله الديموقراطيه الزائفه الوعود الكاذبه دائما تهدد الولايات الفاشله بالعقوبات علي الدول متي تعاقب امريكا علي سفك الدماء وصنع الارهاب ؟',2),(1771,'﻿حسستني انكم بنيتو وطن وجنبتو الشعب سفك الدماء وعمرتو الجسور وبنيتو ناطحات سحاب اقبح منكم ماشفنا انتم وطالبان متشابهين والايام تثبت كلامي في افغانستان عيفعلو مثلكم انتو خوات ياباشا ،',2),(1772,'﻿مجرد رؤيه مناظرهم نتذكر سفك الدماء الله يفرجها ع الناس هناك والله يستر ما يرجعون للمنطقه العربيه مره اخري',2),(1773,'﻿حبيبتي يا اسمي من بعدك يا ست الكل بس والله لاصعب الامور ان يرفع المسلم السلاح بوجه اخيه المسلم وان هدم الكعبه اهون عند رب العزه من سفك الدماء لذلك فهذا حل وسط تتجنب به مصر الدم',2),(1774,'﻿افغانستان ماحدث فيها من خطه الانسحاب الجهنميه الامريكيه انما هو تاسيس نسخه داعش العراق نوع من الفوضي الارهابيه الخلاقه لجعل المنطقه محاصره في اتون لاينطفيء من سفك الدماء',2),(1775,'﻿رجل حكيم فضل عدم سفك الدماء ولا مقارنه ابدا بينه وبين عبد ربه بالمطلق',2),(1776,'﻿انت حيوان والحيوان افضل مني ومنك ما تقارن حيوان ما سفك الدماء بلبشر الي قريبا راح يدمرو الارض ويدمرو الكعبه والقدس وكل الجوامع',1),(1777,'﻿وهل امثالك ممن يؤيدون سفك الدماء ويرقصون ويهللون من اجل الظلم يعرفون الله الواحد القاهر اه من المنافقون امثالكم',1),(1778,'﻿راسه يابس متعرف شيريد غير سفك الدماء والقتل والحروب عابت هيج خليفه',1),(1779,'﻿مافيا الاحتكار كالسياسي الفاسد لا يهمه سفك الدماء مقابل حمايه فساده الله ينتقم من الاثنين',1),(1780,'﻿بمناسبه النار انتظروا جايتكم هديه العيدهههه النمله بس يقترب هلاكها تطلع لها جناحين و اجنحتكم عابره للقارات و وصلت للحزائر اسمها سفك الدماء مو فتك الدماء ياحرميه الشباشب ياحثالات العالم',1),(1781,'﻿وستبقي دائما وابدا رابعه العدويه والنهضه رمز الصمود وستظل هذه الاشاره تؤرق من سفك الدماء قتل الابرياء',1),(1782,'﻿اللهم انتقم ممن سفك الدماء رابعه تشهد',2),(1783,'﻿والحسين بس لشيعه لو ابن بنت نبينه ونبيكم وين سفك الدماء بل موضوع يعمي مو احنه الي نفجر مجالس العزاء ولا احنه الي نفجر الاسواق والتجمعات ولا احنه نحلل دم المسلم',2),(1784,'﻿وحتعيش مصر طالما فيها ناس من كل خلفيه يدركون معني سفك الدماء ويندثر طبالين الهلاك والعنف رابعه تشهد',2),(1785,'﻿لعنه الله والملائكه والناس اجمعين عليك وعلي حكام تعز وحجه حتي سفك الدماء له مقايس يا ك لب تف علي وجهك',1),(1786,'﻿سوء تقدير لمن دعي للاعتصام ويتحمل مسؤليه سفك الدماء الطاهره النتائج كانت سيئه وعن نفسي ساسل الله واختصم كل من دعي لهذا الاعتصام حسبي الله ونعم الوكيل فيهم',1),(1787,'﻿من الضروره النضر الي القضيه اليمنيه بنظره اهتمام لان الوضع الحالي يزيد من سفك الدماء والخراب والقتل والازمه الانسانيه',2),(1788,'﻿الخيانه من ابشع مااشوف والمفارق مثل سفك الدماء لاتعذر علي شان الظروف وانت حبك علي قد السماء',4),(1789,'﻿تذكرين من ابوج ضرب الامام بالمدافع والرشاش ام الوصخ بنت الحرام بنت القذاره حفيده الامويين تموتون ع هدر الدماء يهود',1),(1790,'﻿كلام صحيح مائه بالمائه وهذا ما اتوقع ان يحصل قريبا لان الامريكان سئموا من هدر اموالهم علي دول لا تجني من ورائها الا الدماء والخراب',4),(1791,'﻿الفلسطينيين يقدسون ايران الي تقتل الشعب السوري ويسمون قاسم سليماني شهيد القدس رغم انه جان يحارب السوريين ودمر العراق بميليشياته الدماء مو مشتركه ابدا انتو الفلسطينيين ترسلون التحيات لبشار الاسد الي هدر دم الشعب',1),(1792,'﻿اني مجاي اناقشك باعلميه السيد او مرجعيته، الجواب الوحيد المنطقي بنظري انوا السيد جان يشوف موضوع اسقاط صدام يسوي الدماء الي راحت هدر خلال ال٦ سنوات وره ال٨٢، تدري من طرف يطلب وقف اطلاق النار لازم يكون منسحب والعراق منسحب وميصير كلها كلاوات، لان نصير مثل لا وحي جاء ولا خبر نزل',1),(1793,'﻿فك وافك من اقدم سياسات التفاوض التي عرفها التاريخ ، والتي قادت للصلح بالنهايه لوقف هدر الدماء وحضرت المشهد بعيني',2),(1794,'﻿هههههههههه كل منطقه بيها ارهابيين لازم تنجرف ليش يمه العراق مال الخلفك الدوله لازم تحمي الناس مو تهجولهم والي متكدر يحمي الناس خل يتكتر',1),(1795,'﻿استاذ علي موضوع الطارميه حاله حال جرف الصخر الاهالي او بعض من يسكن هذي المنطقه هم ارهابيين',4),(1796,'﻿شحلاتها هسه من يتعلگون حتي لو عشره ارهابيين من سجن الحوت بمحلها والله وطاح حظك يالكاظمي',1),(1797,'﻿انتم ارهابيين والعلمانيه ستنتصر عليكم ياو حثالات التاريخ ، تتفلسف واغلب اهلك ينتعمون العيش باوروبا مهما حاولتم التظليل تضلو ارهابيين رجعيين متخلفين عن الحضاره وعايشين اوهام ١٤٠٠ سنه جهل وتخلف وطائفيه ومذهبيه',2),(1798,'﻿اي مانختلف هاي السعوديه مو حكامها ارهابيين مثل ماتفضلت بس شعبهم مرفه مو مثل شعبك كاعد بالتجاوزات البصره اغني مدينه بالعالم بيها تجاوزات',1),(1799,'﻿نعم ارهابيين وقتله وذباحين واذا ماعاجبك اضرب راسك بحذاء تربيه عمر ذبح وقتل بعد ماكو مجامله',4),(1800,'﻿قائد الشرطه الافغانيه كان يعطي الاوامر بقتل المجاهدين من طالبان بالتنسيق مع الامريكان فهو مجرم خائن صنعته امريكا لقتل الطلاب المجاهدين هل تعفوا عن قيادات القاعده ام تعدمونهم؟ فانتم ارهابيين بنفس منطقكم',2),(1801,'﻿ورقه تلعبها امريكا متي ما شاءت، تجند من تشاء وتكلفهم بمهام وتطلق عليهم ارهابيين بالاتفاق مع الخونه',2),(1802,'﻿هذا حيدر علساس تشريني ووطني ومره من المرات تشمت باطفال الموصل وسواهم ارهابيين، عموما من الشيعه طائفيين ودونيين ويستغلون اي فرصه حتي يعبرون عن نقصهم',1),(1803,'﻿كانوا عنده ارهابيين قبل يروح طحنون تركيا هو تبع اسياده ال نهيان',2),(1804,'﻿هذولي ارهابيين تجار مخدرات',1),(1805,'﻿لو حكومتكم قالت انهم مجاهدين راح توافقوهم ولو قالت ارهابيين راح توافقوهم انتم دائما تثقون ثقي عمياء بملككم',1),(1806,'﻿وان يريدوا ان يخدعوك فان حسبك الله ۚ هو الذي ايدك بنصره وبالمؤمنين ثاني مره اكتب هاي الايه الكريمه هؤلاء العن خلق الله ارهابيين',2),(1807,'﻿اوكي يا الارهابي اقسم بمن احل القسم لا ابلغ عليك واصعد الامر لو اروح لقسم الشرطه مانبي ارهابيين بينا',2),(1808,'﻿طالبان ارهابيين ومن يدافع عنهم ارهابي ومن التقي بهم قاتل ومجرم',2),(1809,'﻿ليش اكو بيهم ارهابيين ودراويش يضربون نفسهم بالسيف وبيهم شيعه ومسيح وفيهم ذيول للفرس والعرب اخي بكل مجتمع تلكه كلشي كلاشي هذا التوظيف السياسي غير عادل وغير قانوني وفي البلد الي انت عايش بيه المفروض تتعاقب بالسجن علي هكذا استخدام ولكن لا يوجد قانون يطبق اليوم في العالم كله',1),(1810,'﻿طالبان ارهابيين ومن يدافع عنهم ارهابي ومن التقي بهم قاتل ومجرم',2),(1811,'﻿وتسميهم جهاديين هاذم ارهابيين انتم لكم نفس التوجه الاجرامي باختلاف تسمياتكم',1),(1812,'﻿الاسلامچيه گدرو يظللون عن انتهاكات الدوله الصينيه الملحده كافره حسب قاموسهم للاقليه المسلمه، الايغور خل نشوف اذا ينجحون بالتضليل عن قتل فعلي للشيعه من قبل ارهابيين في افغانستان متعرف، يجوز هم ينجحون؟ مو ايران تدعم دوله مسيحيه ضد دوله شيعيه و الكل مغلسه؟',2),(1813,'﻿ولا اطلقوا معتقل سياسي اصلا طالبان تؤمن بالعنف كل الذين اطلقتهم ارهابيين',2),(1814,'﻿بس فد مداخله، السنه من تظاهروا، مو طلعوا ارهابيين وجماعه الخيم و اشكال التسميات، تريد السنه يطلعون حتي ينذبحون؟ والشغله الثانيه، هو الحكم المن؟ لليزيدي والمسيحي والسني، لو للشيعه؟ اي واحد يطلع يطيح حظه هو والمنطقه كلها، احجي حجي منطقي، واخيرا تبقي الشعائر بصوب وقضيه الحسين بصوب',2),(1815,'﻿طالبان ارهابيين ومن يدافع عنهم ارهابي ومن التقي بهم قاتل ومجرم',2),(1816,'﻿الفصائل الاسلاميه تختلف عن بعضها، وطالبان تختلف عن د١عش د١عش ارهابيين ١٠٠٪ متوحشين مجرد ماتخالفيهم بشي تافه ماتضمني راسك يضل موجود يعشقون الدماء وعندهم قتل الاهل اولي من الغريب واتوقع اغلبهم مخابرات لتشويه الاسلام',2),(1817,'﻿مجرمين ارهابيين واستوفت محاكماتهم جميع السياقات القانونيه واهمها كشف الدلاله اذا لماذا هذا العويل وانتم تقولون العين بالعين والسن بالسن وبشر القاتل بالقتل',2),(1818,'﻿اكيد راح ترسلون ارهابيين زي ما ارسلتوا علي والده و يسمون انفسهم صحفيين و يفجرون انفسهم اي ديانه هذا ؟',2),(1819,'﻿ديگلك سياسيين يعني الي يحچي علي الحكومه مو ارهابيين و يجوز غير شي هم لان كلام الاعلام مو شرط يكون حقيقي',2),(1820,'﻿لان الي يملكه اعظم واخطر ارهابيين',2),(1821,'﻿فلا تقلي خيانه وتتكلم زي طالبان والارهابيين هذولي وتقلي ان الي يتعاون مع الامريكان خاين هذا كلام ارهابيين مو فاهمين ايش صاير، فعشان صوره قوميز تري انا جالس اخذ واعطي معك باريحيه',2),(1822,'﻿يقول عن نفسه حساب يقوم عليه مجموعه من طلبه العلم انتم تستعبطون، انتم ارهابيين، ولا تمثلون الدين انتم مو انبياء',2),(1823,'﻿يعني هذا دائما يجيب طاري الطارميه، ما اعرف منو عنده بيها، الطارميه صدك مسمومه و المفروض تصير مثل جرف الصخر ، كلهم ارهابيين،،،،، الله يعطي العافيه لاحمد، يضوجهم',1),(1824,'﻿سؤال الي اتباع السيستاني انتم موش تكولون المالكي هو سبب دمار العراق و قيس الخز مجرم و عميل زين شعدهم بالعتبه اللي تملكه المرجعيتكم زين ليش ما تطردهم موش هذوله ارهابيين و المرجعيتكم تنبذ الارهاب اعرف جوابكم',1),(1825,'﻿قال رسول الله ص المرء علي دين خليله وانت يا مسلم كل اخلاءك ارهابيين تكفيريين لعنه الله عليكم اجمعين',1),(1826,'﻿الحسين ثار ضد طواغيت و ارهابيين مثل هذا الشرذمه جريمه و لو هيه ركضه طويريج بدعه دخيله علي الطقوس الحسينيه',1),(1827,'﻿باي مكان باليمن هم ساعدكم الايمن وتقول عنهم ارهابيين وهم استغلوا عدوانكم علي اليمن وجنوا ملايين من الدولارات من نفط وغاز مارب',1),(1828,'﻿تونسوا كل تويتاتهم بعدها موجوده يعني فوك ما ارهابيين همين مطايه',1),(1829,'﻿بس لمعلوماتك تقريبا ٢٢ بالميه من سكان افغانستان هم شيعه يعني تقريبا بكد سنه العراق اذا استثنينا الاكراد محاوله لسق تهمه تخريب العراق بالشيعه بعد ٢٠٠٣ هي تنصل من المسؤوليه السنه كما الشيعه تقاسموا المسؤوليه اذا كان سياسيي الشيعه سراق سياسيي السنه ارهابيين',1),(1830,'﻿هذولي كلاب صحونج اللي يقولو عملاء امريكا اجل لاعب خلوه عميل هاللاعب منحاش لان طالبان تحرم كل الانشطه رياضيه وفنيه واي شخص يمارسها تقوم بجلده لانهم خوارج ارهابيين متشددين بالدين لعنه الله عليهم خريجين مخابرات اسسوهم الامريكان بالثمانينات من اجل تشويه الاسلام',1),(1831,'﻿٠ الشعب الافغاني شعب مخالط لجميع الاوبئه بالالاف عملا وخونه وبالالاف ارهابيين وبالالاف مرتزقه وقليل ماهم بسطاء',1),(1832,'﻿خاب انلصم انت وداعس المجرم والحشد الارهابي ما اشتريكم بنعال يا ارهابيين المسيار زواج دائم ع فكره مو منقطع مثل المتعه بالنهايه انتصروا مجاهدين طالبان والفرحه صارت بالقدس بس الوجع والصراخ صار بايران واحذيتها امثالك',1),(1833,'﻿كلامك هذا صدك يثبت انك انسان سطحي وجاهل لان اني كلت انو البعثيه ارهابيين وفاسدين بس مو بكد فساد وارهاب سياسيي و ولائيي الحاضر',1),(1834,'﻿صحونج ارهابيين خوارج ذليل واحد يغت ب اطفال ويتاجربالمخدرات يفجرويقتل بالناس علي اي اساس اؤيده كلاب مخابرات اسسوهم بالامريكان بالثمانينات لمحاربه الاتحاد السوفيتي لا تنسي كلبك ابن اسامه بن لادن كان بايران وتزوج هناك وزعيم طالبان قتل وهو خارج من حدود الامريكيه لعنه الله عليهم',1),(1835,'﻿هذا الي بتكلم عليه اغلب ارهابيين سيناء هم غير مصريين اصلا جايين متسللين من برا',1),(1836,'﻿بلا بلا بلا مراكش مصنفه مصراته انساني يا حقوده هي عاصمه المرابطين والموحدين الذين حكموكم يا بلهاء واطفالنا بالف خير علي الاقل ليسوا معرضين للحرق من ارهابيين مثلكم',1),(1837,'﻿اي نطام يتبع لايران تجده ارهابي رؤساء واحزاب امثال شخار الجرو وامثال حزب الشيطان وانصار الشيطان ونظام الصدر جميعهم ارهابيين اللهم انصر الاسلام والمسلمين علي اعداء الاسلام',1),(1838,'﻿يحليله ربي يحفظهم اذا هم ناس مؤمنين وليس ارهابيين',2),(1839,'﻿هذولي دواعش ارهابيين كفار يحللو الحرام ويحرمو الحلال',1),(1840,'﻿في عهد اوباما تم اخراج ارهابين من سجن غوانتانامو وارسلهم الي قطر لتدريب ارهابيين في ليبيا وسوريا واليمن وبالفعل تم تدمير ها حسب المخطط اليوم يتم ارسال افغان وتسليم طالبان السلطه واجتماعات في قطر فهل تكمله المخطط مستمر فهل استعدت الشعوب الوقوف صف مع القياده مجابهه الخطر',2),(1841,'﻿والفين افغاني يستقرون في دوحه الارهاب اضافه لما سبقهم من ارهابيين من مختلف الشعوب بديلا لابناء قطر الاصليين ال مره هزلت والله ان تنزع جناسي ابناء الوطن وتمنح للغريب',2),(1842,'﻿اصلا بالسنوات الفاتت الي يقيم العزاء الحسيني جان مهدد هوه وعائلته بالقتل اما من الانظمه السابقه ومن ارهابيين هسه من اكو امان والشيعه صارو اقوياء شلون',2),(1843,'﻿هما ؟؟ ع اساس انتم ملائكه عل اقل مهما يكونون مو مثلكم ارهابيين ما ماذين بس انفسهم بس انتم اذاكم للناس تفجيرات ذبح سبي نرجع للواقع هم ارحم منكم',2),(1844,'﻿انسي الاعلام لانو اعلام ماجور الڤيديوهات الي انتشرت ؟ هسا لو انهم م