ارهابيين مشكله امريكا فقدانها المصداقيه',1),(2959,'﻿ذراري قتله الحسين عليه السلام خلي يشوف ابو الوطنيه',1),(2960,'﻿لانهم يتبعون قتله الحسين عليه السلام',1),(2961,'﻿بس احنا من امه محمد عليه واله افضل الصلاه وسلام والحسين سبطه الحسين مو مثل اي صحابي سيد شباب اهل الجنه والرسول يقول حسين مني وانا من حسين فمكانه الحسين واهل بيت رسول تختلف عن صحابه بس فكري بطريقه قتله شلون متساهلين بالموضوع انتم الهدرجه وتضحكون',1),(2962,'﻿هو بيلوم الزمن الي اشتري منك ماوزنش فماتحلمش، ضروري وبلا غرور ان نتاكد ان من حولنا يعرفون قيمتنا والا فالانسحاب وان صعب هو الحل',3),(2963,'﻿بس واقعيه وعلي الحجار مبدع',3),(2964,'﻿لا صحه للاخبار المتداوله بشان تنفيذ حكم الاعدام في حق قتله عبدالله الاغبري غدا السبت الجديد في القضيه هو انه قد تم التصديق علي حكم الاعدام من قبل مهدي المشاط رئيس المجلس السياسي الاعلي ب صنعاء، ومن المتوقع ان يتم تنفيذ حكم الاعدام قريبا، ولم يتم تحديد اي موعد',1),(2965,'﻿عاجل صنعاء تحدد يوم غد السبت موعد اعدام قتله الاغبري ال تعرف علي مكان الاعدام ؟',1),(2966,'﻿عادي هواي منتسبين لو بلدفاع لو بلداخليه وعدهم كواتم ، لان تعرف اصلا التعيين من البدايه عن طريق الفصائل لو الاحزاب وهذول كلهم عدهم كاتم ، تعرف نص المنتسبين هم قتله جيش المهدي وبقيه الشله، يعني شكو بيها اذا واحد بالدفاع وبالعصائب بنفس الوقت وعنده كاتم هديه من شيخ المجاهدين',1),(2967,'﻿زينب الشموخ والاباء اللهم العن يزيد اللهم العن حرمله اللهم العن ابن مرجانه اللهم العن خولي اللهم العن سنان ابن انس اللهم العن شمرا اللهم العن عمر ابن سعد اللهم العن قتله الامام الحسين عليه السلام',1),(2968,'﻿صارلهم يومين بهذا الهاشتاك ومسوين قائمه باسماء القتله همين بمنطقهم يعرفون القتله قبل ١٤٠٠ سنه بس ميشوفون الارهابيين قتله الابرياء بظل الكاميرات والتصريحات ب ٢٠٢١',1),(2969,'﻿الحسين لو اراد القتال والدماء كان بساطه اخذ جيوش مجيشه وراح بيهم ليش اخذ اهل بيته واصحابه وبيهم النساء والاطفال هذي اكبر حجه ودليل علي ظلم وجشع وغطيان الدوله الامويه الملعونه اخر حجه حجها الامام الحسين ع ارادو قتله لو كان معلق بستار الكعبه اما البيعه للفاسق يريد او قتله',1),(2970,'﻿ائمه الدماء واتقق الائمه الاربعه علي ان من ثبت ارتدا ه عن الاسلام وجب قتله واهدار دمه و