يبقي كلب ايران حسن نصر الله ممسكا بخناق اللبنانيين مغامرا بمستقبل وطنهم من اجل ارضاء وليه السفيه؟ الا يوجد من يقصي هذا العميل؟ فضيحه والله اوطان تتدمر من اجل عصابه طائفيه قذره؟ اي اوطان تلك؟',0),(4699,'﻿اكول يهديهم ع بعضهم بدون طائفيه',0),(4700,'﻿منشور طائفي وهدفه اثاره الفتنه بس يعني يوم العاشر من محرم يوم الاستشهد بي حفيد الرسول الاعضم شيصير اذا لطمو وسدو محلاتهم وكلمن وحريته تره ماكو اجباري وهوه يوم واحد يعني راح توكف الحياه لو تموتون اذا سدو محلاتهم بهليوم كافي طائفيه وفتنه يا ال اميه لعنكم الله',0),(4701,'﻿اي والله الصراحه تويتر ينرفز بيه هواي طائفيه واني جديد عليه',0),(4702,'﻿والله صاحب هذا الحساب يريد دس السم بالعسل فهذا السؤال يتبين انه بريء ولكن الغايه منه طائفيه',0),(4703,'﻿سب الصحابه يولد كراهيه تجاه العقيده الاخري بالتالي طائفيه وتؤدي الي القتل كالعاده سواء سني او شيعي',0),(4704,'﻿كلنه ندري بس بهلفتره وماراح يفيد هلحجي انتي تسوي طائفيه لا غير',0),(4705,'﻿ها طائفيه طلعتي تبغضين ال البيت ناصبيه هيج يسون بيج اذا حجيتي عليهم',0),(4706,'﻿في احد ردودها ترد وتقول ما نريد معتقداتكم تؤثر عليه منو لازمكم ما تفتحون ؟ ما تشتغلون وتبيعون منو كايللهم الا تعزلون ؟ وثانيا شريكك بالوطن ما تتحمله يوم واحد شلون رح تخلص العمر وياه ؟؟؟ طائفيه نتنه قذره',0),(4707,'﻿براءه منج الحسين ليوم القيامه كان الامام ع ناصرا للفقراء والمظلومين ولم يسرق قوتهم وانت سرقتي مليارات ما شفناج سويتي دار ايتام لو انطيتي لعائله فقيره لو فتحتي مدرسه اومستشفئ خلصتيها طائفيه وهسه قربت الانتخابات صرتي انت وامثالك من الحشرات تتاجرين بقضيه الامام الحسين ع',0),(4708,'﻿اشوف ردود هنا كلها طائفيه وتحريض شلون تلزم لسانك وماتحجي ماعرف والله',0),(4709,'﻿عادي مابيها شي ماكو طائفه ثانيه حسين للجميع واذا مانطلم نحترم هذا الشهر لخاطر نبينا بعدين انتو مو ضد طائفيه ؟',0),(4710,'﻿يعني مثلا انت هسه تضحك لا ابدا علي فكره تره هاي طائفيه مصطلح الشيعه والسنه الي طلع بثوره اكتوبر ماكان بس سني ولا كان بس شيعي تحسسوني مستغربين من هاي الطقوس وهيه نفسها مستمره كل سنه وكل مره نفس الاسطوانه هاي مال منو سرق الي رايحين زياره ناس عاديه شنو الي تسرقه بعد كافي تره',0),(4711,'﻿اي وربي كميه طائفيه مو طبيعيه هنا',0),(4712,'﻿يعني بدل منطالب بتفعيل قانون العنف الاسري وتعديل قانون جرائم الاغتصاب صرنا ندور طائفيه الحيونه الذكوريه موجوده بكل مكان وبكل زمان اذا اكو حيوان بالجنوب او حيوان بالغريبه شرح تفرق للطفله هاي',0),(4713,'﻿هاي الحسابات تريد تخريب وتدور طائفيه تريد تظهر الجنوب انه متخلف والشمال والغرب هم ارقي واحسن وهذا مو صحيح بكل مكان تلگه الزين والموزين اما الوضع العام ماساوي كله سواء من الشمال للجنوب',0),(4714,'﻿انته تخرط شجاب هاي ع هاي لو چف قضيت الحسين مترضون عليه ال تخلون بيه انه ستوووو كافيكم طائفيه دمرتونه',0),(4715,'﻿حبيبي اذا احد استفزك بغير مكان هذا مو موضوعنا، الموضوع الاساسي هذا كدامك فيدو كله طائفيه وبدون اي استفزاز من الجهه الثانيه، بعدين مو الحسين مدرسه وثوره ليش ما يطبق تعاليم حفيد الرسول عليه السلام ويغرد فقط الي يناسب الكل وما يعبر عن حبه للحسين بمقطع طائفي',0);
INSERT INTO `iraqi_sentences` VALUES (4716,'﻿تحجي صدك انت شايف منشوراته كلها طائفيه و منو كال دكتور شو ياهو الي تلزمه كاتب',0),(4717,'﻿جاي اشوف اشياء عجيبه اليوم شكد ماكو طائفيه',0),(4718,'﻿زوجها علي مايكدر يدافع عنها ؟؟؟؟؟ بس هو هذا انتوو تتبعون الروايات الحمقاء الي تسوي طائفيه بين المسلمين مثل الزمال بدون تفكيرر وبس تريديون زله من الناس حته تقتلون وتهمشون وناس تبغض ناس',0),(4719,'﻿طبعا انت شكد غبي ودماغك متروس تبن وبس تحجي هيج بس اهم شي اسوي طائفيه ولك روح اقراء التاريخ عدل روح شوف هو منو ضرب ولك انت غبي ولك هي مو بنت رسول الله شلون يضربها ويمد ايده عليهه زين اوك الرسول يعني ما سوي شي من ضربها هو كافيي انقرضو وانجبوو زين زوجهه علي الن ابي طالب',0),(4720,'﻿جائحه جحا حقيقه تصرف حكيم للهروب مما يراد لها من مكر مدروس لجر المنطقه لاشكالات طائفيه نتنه',0),(4721,'﻿احمد اترك مشاعرك الشخصيه السلبيه عن السوريين ولا تقيم وزنا لجماعه القوميه السوريه اغلبهم اقليات حاقده لاسباب طائفيه المساله مالها علاقه بالعاطفه انما بالحقائق شلون تشكك بعروبه بلد سكنته اقوام عربيه من قبل الاسلام بقرون',0),(4722,'﻿هو هذا حل تذكرين من ٢٠١٤ الي ٢٠١٨ تقريبا طائفيه انتهت ليش لان كان هناك عدو مشترك بس الاعلام و سياسين رجعوا طائفيه بعد ٢٠١٨ الي يكدر ينجح هاي خطه هو الاعلام ودليل من زار بابا العراق الاعلام بداء يركز علي سلام شفتي كل عراقين صاروا ملائكه بسلام',0),(4723,'﻿لازم ينطي لمسه طائفيه للموضوع',0),(4724,'﻿بيا سنه راح يجي محرم وماكو طائفيه والوضع طبيعي؟',0),(4725,'﻿مو انتم جماعه المقاوله تتهمون السنه دواعش ابد مو طائفيه نتم الحشد',0),(4726,'﻿هذا الكلب ضرغام يريد فتنه طائفيه مدفوع من الاحزاب السفله',0),(4727,'﻿والله لم تصدق وهي كاذبه طائفيه مقيته',0),(4728,'﻿اسوء تايم اليوم ملل ونقاشات طائفيه مالها داعي',0),(4729,'﻿لا صدك بربك هسه اني كلبي ملچوم علي الحسين ما اكدر اضحك يعني عرس ومنتشر وكلها شافته هذا مو زرع طائفيه وعدم احترام اخوانكم الشيعه؟ والي همه يمثلون الاغلبيه علي السنه؟ هذا مو استخفاف بمشاعرنا؟',0),(4730,'﻿ايي والله خاصه طائفيه',0),(4731,'﻿طائفيه وثاني شي عفن جوائز اوروبا كله نقاشات',0),(4732,'﻿حيدر اكيد هذا ليس اسمه الحقيقي اولا يحاول بهذا القول بث فتنه طائفيه يستفز بها الاخرين',0),(4733,'﻿اكبر طائفيه حضرتج',0),(4734,'﻿هذه خلاصه تغريداته الطائفيه يريد ان يغرق اليمن بحرب طائفيه ارجوا من المحاميين رفع قضيه علي هذا المنافق الخائن واحالته الي المحكمه باسرع وقت',0),(4735,'﻿ميليشيات طائفيه واتباعه وضيعين مثلها اسكتز اتباع تجار المخدرات حزباله',0),(4736,'﻿شكد اكره الشيرازي الوحيد الي يسوي طائفيه بين الشيعه والسنه',0),(4737,'﻿هسه انتي صرتي طائفيه ومليشاويه لان حجيتي هيج',0),(4738,'﻿هذا ساعه شيعي ساعه مسيحي ساعه سني وبعدين يطلع علي قناه طائفيه وي شيخ قذر اسمه العرعور',0),(4739,'﻿كميه طائفيه تجيب الغثيان',0),(4740,'﻿انت اكبر طائفي تغريداتك طائفيه معاداه للطائفه السنيه معطلين لتشكيل حكومه ماخذين لبنان لجهنم بلا ماء بلا كهرباء بلا وقود بلا ادويه بلا قمح كل هذا بعهدكم، رهنتوا لبنان لايران وجاي تسترجل بتغريده',0),(4741,'﻿هس هيه مشكلتها ليش شرقيه ماتذكر هاي الانتهاكات بالمناطق الغربيه وشماليه ومسويتها كارثه الكوارث وتاركه هاي طفله مسكينه مغتصبه ولا تكتب اني مو طائفيه شلون يابه انتي مو طائفيه وانتي تتهمين قناه بالطائفيه لمجرد محاولتها نقل واقع وللعلم هاي قناه تحاول تغطي كل فضايح محافظات بس متلحك',0),(4742,'﻿سني شيعي من اي ديانه اذا بيك طائفيه لا اتابعني ولا تشوفني چهرتك مللتوناا شوكت نخلص',0),(4743,'﻿شكد طائفيه وهمج الرجال عاش بطل ومات بطل انتوا التحجون اذيول ومفرخه مالكم بالحسين ابو عبدالله بريء منكم لا تلحكون بافعال الحسين ولا تلحكون بافعال صدام هذا النفاق والدجل شنو بطلوا هاي سوالف المزعطه هذا شهر محرم حرمت بي المعارك مانزلت بي غير الرحمه والموده',0),(4744,'﻿سعاده النائبه مصيبه علي الشخسعد انت قلتي وقت حادثه خلده انك كل عمرك تضلي تحت الجسر مع النور من ايمتي لمثلك بيفهموا بولايه الفقيه وبالهلال الشيعي كمان بتحكي طائفيه يلا يا هبله انت ورفيقتك ديما جمالي الله يكثر من امثالكم بتيار المستقبل حتي نضل نضحك عليكم وعلي امثالكم',0),(4745,'﻿جاي ادور علۓ الباسبور والله ماابقا اشوف هيج ناس طائفيه مليت واني احضر سامحوني',0),(4746,'﻿انفتاح ؟ مخك قفل عقليه متعصبه متطرفه طائفيه جايه عم تنتقم من الناس',0),(4747,'﻿شنو هذا التايم طائفيه فول',0),(4748,'﻿قصص خرافيه شكو حشرت نفسك بشي مايخصك لو اله تنافقون وتحشرون نفسكم بكولشي ماعاجبك لاتدخل كافي طائفيه حسد وغيره',0),(4749,'﻿هههههه عرفتها التقصدها اذا اكو طائفيه فهيه',0),(4750,'﻿انا ماحب اتكلم في ذي السوالف وكلش ماحب اتناقش في ذي المواضيع ولا انا طائفيه بس الي قاعد يصير كلش غلط مانبي نرجع نفس قبل مايصير هلون',0),(4751,'﻿من تكون صداقات او تحب مراح تسال شنو طائفتك من تطلع تتونس مع زملاءك بالعمل مراح تختار ناس بنفس طائفتك بس من شفنه الحكومه ورجال الدين شلون حللوا دمنه بتشرين وقتلونه لان بس نريد حياه كريمه مات عمر وعلي وعيسي والكل اسعف الي يكدر عليه وبجي وتاثر وكانوا احد من عائلته فماكو طائفيه بينه',0),(4752,'﻿بس تحجين علي الشيعه بشكل عام وعلي سياسيين الشيعه بشكل خاص راح تصيرين مدنيه ومحبوببه كلش من قبل السنه والتشارنه بس جيبي طاري السنه او الاكراد او حتي ذكر مناطقهم العفنه راح تصيرين انتي طائفيه وتحجين باسم الطائفيه ترا هم كلهم هيج لهذا احنا ما نهتم ونصيح بعلو الصوت احنا شيعه',0),(4753,'﻿شاركوهم بلحلوه والمره انتو ابناء بلد واحد ومنشورج مملوئ طائفيه وحقد وكره ياريت تحذفينه لان هليام الطائفيه جاي اشوفها تتكاثر بسببكم',0),(4754,'﻿هسه وين اكو بكل مكان شنو بكيفج قابل تعالي شوفي مناطقنا والله طلقه متسمعين بيها وبنفس الوقت اني عندي هوايه اصدقاء بمحافظات الجنوب همه نفسهم يگلولي مجتمعنا كارثي يوميه عركات وثارات وفصول وبلاوي بس الله يدري بيها حتي عيب متنحچي فلتلعبين علي هذا الوتر تره ماكو طائفيه بهيجي امور',0),(4755,'﻿ماعدنا جرائم طائفيه بالبصره وهذا حادث يصير بكل محافظه عادي اصلا اشك لغرض طائفي اصلا يجوز عنده ثار او مشكله غيرها',0),(4756,'﻿هاي باطراف الموصل علي ما اعتقد والتصوير قديم وكافي تاكل تبن علمود تسوي طائفيه',0),(4757,'﻿الله يسامحك ، صارت افكار الحرس الثوري غير طائفيه عبث',0),(4758,'﻿يااخي ليش هيج طائفيه وشنو سليماني وابو مهدي مو شيعه لعنه الله ع كل من يثير الفتنه الحسين خصمك يوم القيامه',0),(4759,'﻿شكد جنت احب منشوراتج بس هذا النفس الطائفي منين جايبته عود انتي المثقفه الواعيه الدارسه اكثر من تغريده طائفيه طلعتي اليوم تره الطرفين بيهم فساد وبيهم اخطاء والواعي ينتقد الطرفين بدون ميذكر طوائفهم',0),(4760,'﻿ليش هلگد صعبه تكتب تعزيه بحق ابن بنت رسول الله بينما تشارك المسيحي بالكرسميس و الصابئي بعيد السنه المندائيه و الايزيديه بعيد المحيي و الكردي باعياد نيروز بينما من توصل يم مناسبات الشيعه تخل روحك بخان